sys_variable_value.value:
(function execute(inputs, outputs) {

  var body = inputs.ResponseBody

  var allEmployees = gs.xmlToJSON(body);

  allEmployees = allEmployees['soap:Envelope']['soap:Body']['List_GetByCompanyResponse']['List_GetByCompanyResult']['Employee'];

  outputs.string = JSON.stringify(allEmployees);
  var allUsers = [];

  //Loop through all users
  for(i=0;i<allEmployees.length;i++) {
    var currentUser = allEmployees[i];

    var Employee = {};

    Employee.Number = currentUser.Number;
    Employee.DisplayName = currentUser.DisplayName.replace(/  +/g, ' ');
    Employee.Id = currentUser.Id;

    allUsers.push(Employee);

  }

  outputs.all_employees = allUsers;

// ... code ...
})(inputs, outputs);

